    background: #f7f7f7 ;
    max-width: 80%;
    margin: 0 auto;
    `;
    function Span({ space = 20 }){
	return (
    	<span style={{ paddingRight: space }}></span>
    );
}

    return (
        <div className="prediction_page">
            {/* prediction 내 메뉴 navigation */}
