              </li>

              <li>
                <a href="/Refer/Prediction/*" className="pred_3">
                    3. 주요 기술
                </a>
              </li>

              <li>
                <a href="/Refer/Prediction/*" className="pred_4">
                    4. 성능확인
                </a>
              </li>

            </nav>
    {/* prediciton 내 navigation 끝 */}
            <h1 className="refer-title">
            단백질 구조 예측 AI
            </h1>
        </div>
    )
}
